import React from 'react';
import { Swiper, SwiperSlide } from 'swiper/react';
import { Navigation, Autoplay } from 'swiper/modules';
import 'swiper/css';
import 'swiper/css/navigation';

export default function BannerCarousel() {
  return (
    <div style={{ width: '100%', height: '300px' }}>
      <Swiper
        modules={[Navigation, Autoplay]}
        navigation
        autoplay={{ delay: 4000 }}
        loop
        style={{ width: '100%', height: '100%' }}
      >
        <SwiperSlide>
          <img src="/images/banner1.jpg" alt="Banner 1" style={{ width: '100%', height: '100%', objectFit: 'cover' }} />
        </SwiperSlide>
        <SwiperSlide>
          <img src="/images/banner2.jpg" alt="Banner 2" style={{ width: '100%', height: '100%', objectFit: 'cover' }} />
        </SwiperSlide>
        <SwiperSlide>
          <img src="/images/banner3.jpg" alt="Banner 3" style={{ width: '100%', height: '100%', objectFit: 'cover' }} />
        </SwiperSlide>
      </Swiper>
    </div>
  );
}
